/* PARAMS:
[
  {"name": "u_speed", "label": "Speed", "type": "float", "default": 1.05, "min": 0.0, "max": 4.0},
  {"name": "u_glow", "label": "Glow Intensity", "type": "float", "default": 0.08, "min": 0.01, "max": 0.5},
  {"name": "u_twist", "label": "DNA Twist", "type": "float", "default": 0.42, "min": 0.0, "max": 2.0}
]
*/
precision highp float;
out vec4 fragColor;
uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

uniform float u_speed;
uniform float u_glow;
uniform float u_twist;

// Hardcoded params converted from defines
#define u_fov 0.500
#define u_lookahead 4.900
#define u_gyroid_scale 10.950
#define u_path_scale 1.970

mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

vec2 getPath(float z) { 
    return vec2(
        sin(z * 0.12 * u_path_scale) * 3.5, 
        cos(z * 0.15 * u_path_scale) * 2.0 + sin(z * 0.08) * 1.5
    ); 
}

float gyroid(vec3 p, float scale) {
    p *= scale;
    return abs(dot(sin(p), cos(p.zxy))) / scale;
}

float sdDNA(vec3 p) {
    float z = p.z;
    float angle = z * u_twist + iTime;

    vec3 p1 = p;
    p1.xy *= rot(angle);
    p1.x -= 1.1; 

    vec3 p2 = p;
    p2.xy *= rot(angle + 3.14159);
    p2.x -= 1.1;

    float strands = min(length(p1.xy) - 0.15, length(p2.xy) - 0.15);

    float stepIdx = floor(z * 2.0) / 2.0;
    vec3 p3 = p;
    p3.z = (fract(z * 2.0) - 0.5) / 2.0;
    p3.xy *= rot(stepIdx * u_twist + iTime);
    float steps = max(max(abs(p3.x) - 1.1, abs(p3.y) - 0.05), abs(p3.z) - 0.04);

    return min(strands, steps);
}

float map(vec3 p) {
    vec3 pOrig = p;
    p.xy -= getPath(p.z); 

    float r = length(p.xy);
    float tunnel = -(r - 5.5);

    float safeZone = smoothstep(1.0, 4.5, r);

    float g = gyroid(p + vec3(0, 0, iTime * 0.2), u_gyroid_scale);
    float bioWalls = (g - 0.4) * safeZone;

    float dna = sdDNA(p);

    float d = min(tunnel, dna);
    d = mix(d, bioWalls, 0.4);

    return d * 0.7; 
}

vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void mainImage( out vec4 fragColor, in vec2 fragCoord ) {
    vec2 uv = (fragCoord - 0.5 * iResolution.xy) / iResolution.y;

    float t = -iTime * u_speed;

    float orbitRadius = 2.8;
    float orbitSpeed = 0.15;

    vec2 cameraOffset = vec2(cos(t * orbitSpeed), sin(t * orbitSpeed)) * orbitRadius;

    vec3 ro = vec3(0.0, 0.0, t);
    ro.xy += getPath(ro.z) + cameraOffset; 

    vec3 ta = vec3(0.0, 0.0, t - u_lookahead);
    ta.xy += getPath(ta.z); 

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0.0, 1.0, 0.0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f * u_fov + uv.x * r + uv.y * u);

    float d, dist = 0.0;
    float glow = 0.0;
    vec3 p;

    for(int i = 0; i < 90; i++) {
        p = ro + rd * dist;
        d = map(p);

        glow += exp(-d * 4.0) * u_glow;

        if(d < 0.001 || dist > 40.0) break;
        dist += d;
    }

    vec3 skyColor = vec3(0.02, 0.05, 0.1);
    vec3 color = skyColor;

    if(dist < 40.0) {
        vec3 n = getNormal(p);
        vec3 l = normalize(vec3(1.0, 2.0, -1.0));
        float diff = max(dot(n, l), 0.0);
        float spec = pow(max(dot(reflect(-l, n), -rd), 0.0), 32.0);

        vec3 matCol = vec3(0.1, 0.4, 0.8);
        matCol += sin(p.z * 0.5) * 0.1; 

        color = matCol * diff + spec;

        color = mix(color, skyColor, 1.0 - exp(-0.02 * dist * dist));
    }

    vec3 glowColor = vec3(0.1, 0.6, 1.0);
    // Safety check for dist to avoid infinity
    float safeDist = max(dist, 0.1);
    color += glow * glowColor * (1.5 / safeDist);

    float dnaGlow = exp(-length(p.xy - getPath(p.z)) * 0.5);
    color += dnaGlow * vec3(0.0, 0.3, 0.6) * 0.5;

    color = pow(color, vec3(0.8)); 
    color *= 1.2 - dot(uv, uv);    

    fragColor = vec4(color, 1.0);
}

void main() {
    mainImage(fragColor, gl_FragCoord.xy);
}
